from .shodan_return import shodan_return
from .zoomeye_return import zoomeye_return

'''
作用：使用多线程获取数据+整合页面二数据
输入：类型：字典
     格式：引擎名：该引擎对应的查询语句
     例如：{"fofa": 'city="Taipei"', "quake": 'city:"Taipei"'}
输出：类型：list,
     格式：当flag=False(页面二):{count:{数据条数},data:[{数据1}，{数据2}]}
          当flag=True(页面三):{data:[{数据1}，{数据2}]}
     
日期：2024/4/5
'''


def multi_thread_get(engine_input: dict, flag: bool):
    result_all = []

    def get_from_service(input_value, service_function, flag, result_list):
        result_list.extend(service_function(input_value, flag))

    services = []
    for thing in engine_input:
        t = ()
        if thing == "fofa": t = (thing, engine_input[thing], fofa_return)
        if thing == "shodan": t = (thing, engine_input[thing], shodan_return)
        if thing == "quake": t = (thing, engine_input[thing], quake_return)
        if thing == "hunter": t = (thing, engine_input[thing], hunter_return)
        if thing == "zoomeye": t = (thing, engine_input[thing], zoomeye_return)
        services.append(t)

    threads = []

    for name, input_val, service_func in services:
        thread = threading.Thread(target=get_from_service, args=(input_val, service_func, flag, result_all))
        threads.append(thread)
        thread.start()

        # 确保所有线程执行完毕
    for thread in threads:
        thread.join()

    if not flag:  # 页面二
        re = {'count': {}, 'data': []}
        i = 0
        while i < len(result_all):
            if len(result_all[i]) == 1:
                re['count'].update(result_all.pop(i))
            else:
                i += 1
        re['data'] = result_all
    else:  # 页面三
        re = {'data': []}
        re['data'] = result_all

    return re


